package nov21;

public class WrapperDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 10;

		Integer myInt = i;
		System.out.println(myInt);
		char ch = 'c';
		Character myChar = ch;
		System.out.println(myChar);
		float f = 1000000f;
		Float myFloat = f;
		System.out.println(myFloat);

	}

}
